import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <Link to="/">AboutUs</Link>
      <Link to="/contact">ContactUs</Link>
      <br />
      <a href="/">AboutUS</a>
      <a href="/contact">ContactUS</a>
    </>
  );
};

export default Menu;
